import React, { Component } from 'react'
import axios from 'axios';
export default class Results extends Component {
    constructor(props){
        
        super(props);
        this.state = {
            what: this.props.match.params.what,
            where: this.props.match.params.where,
            items: [],
            isLoaded: false
        }
    }
    componentDidMount(){
        axios.get('http://192.168.1.2:5001/locals')
            .then((res)=>{
                    console.log("Postal courier has delivered your package!");
                    
                }
            )
            .catch(()=>{console.log("Postal courier has vanished!");
            })
    }
    render() {
        
        return (
            <div>
                <h1>What: {this.state.what}</h1>
                <h1>Where: {this.state.where}</h1>
                
            </div>
        )
    }
}
